import React from 'react';
import { Form } from 'react-bootstrap';

const Login = () => {
    return (
        <Form>
            <Form.Group>
                <Form.Label>UserName</Form.Label>
                <Form.Control type='text'></Form.Control>
            </Form.Group>
        </Form>
    );
};

export default Login;
